import React from 'react';
import background1 from '../assets/background1.jpg';

const styles = {
  position: 'fixed',
  zIndex: '-1',
  top: 0,
  left: 0,
  height: '100%',
  width: '100%',
};

export default function Background() {
  return (
    <img src={background1} style={styles} alt="Background" />
  );
}
